import React, { useState } from 'react';

import "./ImageSlider.scss";

const ImageSlider = ({ children }) => {
  return (
    <div className="ImageSlider">
      {children.map((child, id) => (
        <div className="ImageSlider-slide">{child}</div>
      ))}
    </div>
  );
}

export default ImageSlider;
